window.bookSummaryJSON = "<p>The Fire Wolf and I found my abducted twin, but my life is hardly back to normal....</p> <p>Let’s see, my hired hunter has decided I’m his mate, my twin sister is blaming me for her abduction, a crazy and dangerous supernatural is now after <i>my </i>magic, and I’m somehow supposed to keep running Practically Perfect despite the disaster that is my life. </p> <p>Sigh...I just can’t win, especially when the crazy supernatural comes looking for me and my hired hunter goes into full-blown territorial werewolf mode. Did I mention that I haven’t accepted his mating bond? </p> <p>Now, it’s getting real, especially when I learn that my hunter has kept a very dark secret from me...a secret that affects my very way of life.</p>"; 
